import "./App.css";
import React from "react";
import { Route  } from "react-router-dom";
import Principal from "./f_components/f_principal/principal";
import Nav from "./f_components/f_nav/nav";
function App() {
  return (
    <div className="App">
        <Route path="/" component={Principal}></Route>
        <Route path="/home" component={Nav}></Route>
        
    </div>
  );
}

export default App;
